import React, { Component } from 'react';
import { Link } from "react-router-dom";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';
  import { InputGroup, InputGroupAddon, InputGroupText, Input } from 'reactstrap';
  import { Button } from 'reactstrap';
  






  export default class Header extends Component {
    constructor(props) {
      super(props);
  
      this.toggle = this.toggle.bind(this);
      this.state = {
        isOpen: false
      };
    }
    toggle() {
      this.setState({
        isOpen: !this.state.isOpen
      });
    }
    render() {
      return (
        <div >
          <Navbar className="nav" color="none" light expand="md">
            <NavbarToggler className="togger" onClick={this.toggle} />
            <Collapse isOpen={this.state.isOpen} navbar>
            <InputGroup className="inpotfrom">
        <Input placeholder="... ابحث عن درس" />
        <InputGroupAddon addonType="append">
        <Button color="primary"><svg xmlns="http://www.w3.org/2000/svg" width="15.665" height="15.056" viewBox="0 0 29.665 25.056">
  <path id="ic_search_24px" d="M24.2,18.758h-1.34l-.475-.387a8.483,8.483,0,0,0,2.663-6.06C25.05,7.169,20.114,3,14.025,3S3,7.169,3,12.312s4.936,9.312,11.025,9.312A12.224,12.224,0,0,0,21.2,19.374l.458.4v1.132l8.481,7.149,2.527-2.135Zm-10.177,0c-4.223,0-7.633-2.879-7.633-6.447S9.8,5.865,14.025,5.865s7.633,2.879,7.633,6.447S18.248,18.758,14.025,18.758Z" transform="translate(-3 -3)"/>
</svg>
</Button>
        </InputGroupAddon>
      </InputGroup>
              <Nav className="navv ml-auto sm-ml-1" navbar>

              <NavItem className="navitem">
                  <Link to="/contact">تواصل معنا</Link>
                </NavItem>

                <NavItem className="navitem">
                   <Link to="/learn">تعلم </Link>
                </NavItem>
   
              <NavItem className="navitem">
                   <Link to="/learn">الصفحة الرئسية</Link>
                </NavItem>
                
               
               
              </Nav>
            </Collapse>
          </Navbar>
        </div>
      );
    }
  }
